INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 2, 3, 5, 3001, 9, 1, 1, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 0, 2.46, "vo_minigame_1012_result_1082", 12300150);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 2, 3, 5, 3001, 9, 1, 1, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 0, 2.94, "vo_minigame_1012_result_1083", 12300151);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 3, 7, 5, 3001, 9, 1, 1, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 0, 4.19, "vo_minigame_1012_result_1084", 12300152);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 3, 1, 5, 3001, 9, 1, 1, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 0, 0.0, "vo_minigame_1012_result_1085", 12300153);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 3, 3, 5, 3001, 9, 1, 1, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 0, 2.63, "vo_minigame_1012_result_1086", 12300154);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 1, 3, 1, 3001, 4, 1, 1, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 0, 5.53, "vo_minigame_1012_result_1087", 12300155);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 1, 3, 1, 3001, 4, 3, 1, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 9, 0.01, "vo_minigame_1012_result_1088", 12300156);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 1, 3, 1, 3001, 4, 1, 1, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 3, 4.15, "vo_minigame_1012_result_1089", 12300157);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 2, 9, 1, 3001, 4, 9, 1, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 9, 0.01, "vo_minigame_1012_result_1090", 12300158);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 2, 3, 1, 3001, 4, 1, 1, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 0, 5.37, "vo_minigame_1012_result_1091", 12300159);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 2, 3, 1, 3001, 4, 1, 1, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 0, 1.44, "vo_minigame_1012_result_1092", 12300160);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 3, 3, 1, 3001, 4, 3, 1, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 0, 0.0, "vo_minigame_1012_result_1093", 12300161);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 3, 3, 1, 3001, 4, 9, 1, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 3, 2.91, "vo_minigame_1012_result_1094", 12300162);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 3, 5, 1, 3001, 4, 1, 1, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 0, 2.61, "vo_minigame_1012_result_1095", 12300163);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 1, 4, 0, 3001, 0, 2, 1, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 1, 3.63, "vo_minigame_1012_result_1096", 12300164);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 1, 6, 0, 3001, 0, 2, 1, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 1, 4.16, "vo_minigame_1012_result_1097", 12300165);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 1, 3, 0, 3001, 0, 3, 1, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 6, 0.01, "vo_minigame_1012_result_1098", 12300166);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 2, 6, 0, 3001, 0, 2, 1, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 0, 5.75, "vo_minigame_1012_result_1099", 12300167);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 2, 4, 0, 3001, 0, 2, 1, "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！", 1, 5.64, "vo_minigame_1012_result_1100", 12300168);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 2, 8, 0, 3001, 0, 4, 1, "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！", 8, 5.73, "vo_minigame_1012_result_1101", 12300169);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 3, 5, 0, 3001, 0, 3, 1, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 1, 5.32, "vo_minigame_1012_result_1102", 12300170);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 3, 3, 0, 3001, 0, 9, 1, "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！", 9, 2.37, "vo_minigame_1012_result_1103", 12300171);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 3, 9, 0, 3001, 0, 1, 1, "…かなり出来が悪いわね\n一旦休憩しましょうか？\nリフレッシュして頭切り替えて\nもう一度頑張りましょう！", 3, 4.25, "vo_minigame_1012_result_1104", 12300172);
